import { Container } from "react-bootstrap";
import "./Home.css";
function Home() {
  return (
    <Container>
      <section style={{ backgroundColor: "#f7ede3" }} className="p-3 mt-3 home">
        <img src="../home.jpg" className="image" alt="homephoto" />
      </section>
    </Container>
  );
}

export default Home;
